column3:
Bạn đã làm việc rất chăm chỉ trong năm năm qua và bạn cần thêm năm năm nữa để biến giấc mơ về một căn hộ chung cư thành sự thật? 
Sao phải chờ đợi thêm năm năm nữa? Với những mơ ước chính đáng như vậy, bạn đừng ngại ngần đến với MB. Với sản phẩm "Cho vay mua căn hộ, nhà đất dự án", chúng tôi có thể hỗ trợ bạn tới 80% nhu cầu tài chính bạn cần để biến giấc mơ của bạn thành sự thật ngay từ hôm nay.
>> HẠN MỨC 
​• Mức cho vay tối đa: 80% nhu cầu tài chính của khách hàng;
• Thời hạn cho vay tối đa: 240 tháng;
• Thủ tục đơn giản,
• Thời gian xử lý hồ sơ nhanh chóng: từ 1-3 ngày làm việc;
• Phương thức trả nợ linh hoạt, KH có thể linh hoạt lựa chọn: trả góp/trả gốc cuối kỳ, trả lãi định kỳ trên dư nợ giảm dần;
• Chấp nhận nhiều loại tài sản đảm bảo:  quyền tài sản từ Hợp đồng mua bán, Hợp đồng thuê dài hạn, Hợp đồng góp vốn, Hợp đồng chuyển nhượng và Hợp đồng nhận chuyển nhượng lại căn hộ, nhà, đất dự án…. Ngoài ra, MB còn nhận các tài sản độc lập với khoản vay như: bất động sản, giấy tờ có giá, phương tiện vận tải.
>> ĐIỀU KIỆN VAY VỐN 
• Khách hàng có đủ năng lực pháp luật dân sự và năng lực hành vi dân sự;
• Khách hàng có độ tuổi dưới 55 tuổi (đối với nữ) và 60 tuổi (đối với nam);
• Khách hàng có hộ khẩu/KT3 tại Tỉnh/thành phố nơi MB có trụ sở;
• Khách hàng có khả năng tài chỉnh đảm bảo nguồn trả nợ cho khoản vay;
• Khách hàng thực hiện các thủ tục đảm bảo tiền vay theo quy định của MB
>> HỒ SƠ VAY VỐN 
• Đơn đề nghị vay vốn kiêm phương án trả nợ (theo mẫu của MB);
• Giấy tờ nhân thân: CMND/Hộ chiếu, Hộ khẩu/KT3;
• Giấy tờ chứng minh nguồn trả nợ;
• Giấy tờ liên quan đến tài sản bảo đảm/bảo lãnh;
• Các giấy tờ liên quan đến việc mua căn hộ, nhà, đất dự án.
